import React from 'react';
import PostData from '../data/schoolProfiles.json';

function PostList() {
  return (
    <div>
      <h1>School Profiles</h1>
      {PostData.map((schoolProfile, index)=>{
        return <>
        <div class="row">
          <div class="col-sm-6">
            <div class="card">
              <div class="card-body">
              <img class="card-img-top mx-auto" src={schoolProfile.schoolLogoUrl} alt="Card image cap" style={{width: 100 + 'px', height: 100 + 'px'}}></img>
                  <h5 class="card-title">{schoolProfile.name}</h5>
                    <p class="card-text">{schoolProfile.address}</p>
                    <a href="#" class="btn btn-primary">WP Code</a>
              </div>
              </div>
            </div>
          </div>
        </>
      })}
    </div>
  );
}

export default PostList;
